import { Navigate} from "react-router-dom";
const ProductedRoute = () =>{

    useEffect(()=>{
        let token = localStorage.getItem('auth')
         if(token?.length === 0){
            return <Navigate to="/dashboard/profile" replace />;
         }
     },[])
}

export default ProductedRoute
